import { Component } from '@angular/core';

@Component({
  selector: 'app-cars',
  templateUrl: './cars.component.html',
  styleUrls: ['./cars.component.css']
})
export class CarsComponent {

 addCarStatus = "";
 inputText = ''
  constructor() {

  }

  addCar() {
   this.addCarStatus = 'машина добавлена'
  }

  onKeyUp({value}: { value: any }) {
   //console.log(event);
    this.inputText = value
  }
}
